package search

import java.util.Queue
import java.util.LinkedList
import kotlin.test.assertEquals

//1254. Number of Closed Islands
fun closedIsland(grid: Array<IntArray>): Int {
    var result = 0
    val visited = mutableSetOf<Pair<Int, Int>>()

    for (i in grid.indices) {
        for (j in grid[0].indices) {
            if (grid[i][j] == 1) {
                continue
            }

            val pair = Pair(i, j)
            if (visited.contains(pair)) {
                continue
            }

            if (isEnclosed(grid, visited, pair)) {
                result++
            }
        }
    }

    return result
}

fun isEnclosed(grid: Array<IntArray>, visited: MutableSet<Pair<Int, Int>>, start: Pair<Int, Int>): Boolean {
    val newVisited = mutableSetOf<Pair<Int, Int>>()
    val queue: Queue<Pair<Int, Int>> = LinkedList()

    queue.add(start)
    newVisited.add(start)
    while (queue.isNotEmpty()) {
        val pair = queue.remove()

        if (pair.first == 0 || pair.first == grid.size - 1 || pair.second == 0 || pair.second == grid[0].size - 1 || visited.contains(pair)) {
            visited.addAll(newVisited)
            return false
        }

        val neighbors = mutableListOf<Pair<Int, Int>>()
        neighbors.add(Pair(pair.first - 1, pair.second))
        neighbors.add(Pair(pair.first + 1, pair.second))
        neighbors.add(Pair(pair.first, pair.second - 1))
        neighbors.add(Pair(pair.first, pair.second + 1))

        neighbors.forEach { neighbor ->
            if (grid[neighbor.first][neighbor.second] == 0 && !newVisited.contains(neighbor)) {
                queue.add(neighbor)
                newVisited.add(neighbor)
            }
        }
    }
    visited.addAll(newVisited)

    return true
}

